import React from 'react'
import Activitycard from './ActivityCard'

function Activitylist({Activitylist, search,hourly}) {
  return (
   < div className='list'>
{Activitycard.filter((mv)=>mv.title.toLowerCase().includes(search.toLowerCase())&& mv.hourly>=hourly).map((el)=><Activitycard el={el}/>)}
   </div>
  )
}

export default Activitylist
